create table time_table
(
    id       int auto_increment
        primary key,
    name     varchar(50)  null comment '员工名',
    month    int          null comment '月数',
    day      int          null comment '日期',
    on_time  time         null comment '打卡时间',
    m_o_a    tinyint(1)   null comment '上午 true
下午 false',
    type     int          null comment '正常 0
早退 -1
迟到 1
旷工 2',
    comments varchar(100) null
);

